from string import ascii_uppercase

def solve(nums):
    s = ''
    for n in nums:
        if n == ' ':
            s += (' ')
            continue
        c = int(str(n)[::-1])
        # print(c % 26)
        s += (ascii_uppercase[c % 26])
    print(s)

